import React, { useState } from 'react'
import Step from './products/Step'

const Table = ({ headLines, items }) => {

  const headLinesResult = headLines.map((head) => {
    return <th key={head.id}>{head.title}</th>
  })


  const itemsResult = items.map((item) => {
    return item.map((i) => {
      return <td key={i.id}>{i.title}</td>
    })
  })

  return (
    <div style={{ overflow: "auto" }}>
      <table className={`table-dashboard`} >
        <thead>
          <tr>
            <th><input type="checkbox" /></th>
            {headLinesResult}
          </tr>
        </thead>
        <tbody>
          <tr>
            {itemsResult}
          </tr>

        </tbody>
      </table>
    </div>
  )
}

export default Table;
